import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';

class Home extends Component {
  render() {
    return (
      <div>

        <Header />

          <div className="container-page hidden">
            <p data-title>Um <b>fundo de capital de Risco</b> que vale por uma carteira inteira</p>
            <p data-description>Um fundo de capital de Risco que vale por uma carteira inteira</p>

            <div>
              <button data-colored="big">Criar minha conta</button>
              <button data-glass="big">Criar minha conta</button>
            </div>

          </div>

        <Footer />

      </div>
    );
  }
}
export default Home;
